        <p class="p30 ft0">This Guarantee is offered by all Banks and Building Societies that accept instructions to pay Direct Debits.
        </p>
        <p class="p31 ft17">If there are any changes to the amount, date or frequency of your Direct Debit, FastPay Ltd re The Unusual Company Ltd will notify you five working days in advance of your account being debited or as otherwise agreed. If you request FastPay Ltd re The Unusual Company Ltd to collect a payment, confirmation of the amount and date will be given to you at the time of the request.
        </p>
        <p class="p32 ft0">If an error is made in the payment of your Direct Debit by FastPay Ltd Re The Unusual Company Ltd or your Bank or Building Society, you are entitled to a full and immediate refund of the amount paid from your bank or building society.
        </p>
        <p class="p33 ft0 ft24">If you receive a refund you are not entitled to, you must pay it back when FastPay Ltd re The Unusual Company Ltd asks you to.
